import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';

const PlayerDetails = () => {
  const { id } = useParams();
  const [player, setPlayer] = useState(null);

  useEffect(() => {
    const fetchPlayer = async () => {
      const res = await fetch(`/api/players/${id}`);
      const json = await res.json();
      setPlayer(json.data);
    };
    fetchPlayer();
  }, [id]);
console.log(player);
  if (!player) return <p>Loading player details...</p>;

  return (
    <div>
      <h2>{player.name}</h2>
      <img src={player.image} alt={player.name} style={{ width: '200px' }} />
      <p><strong>Country:</strong> {player.country}</p>
      <p><strong>Batting Style:</strong> {player.battingStyle}</p>
      <p><strong>Bowling Style:</strong> {player.bowlingStyle}</p>
      <p><strong>Position:</strong> {player.position}</p>
      <p><strong>Date of Birth:</strong> {player.dob}</p>

      <h3>Career Stats</h3>
{player?.career && player.career.length > 0 && (
  <div className="career-section">
    <h3>Career Statistics</h3>
    {player.career.map((c, index) => (
      <div key={index} className="career-block">
        <h4>{c.type}</h4>
        {c.batting && (
          <ul>
            <li><strong>Matches:</strong> {c.batting.matches}</li>
            <li><strong>Innings:</strong> {c.batting.innings}</li>
            <li><strong>Runs:</strong> {c.batting.runs_scored}</li>
            <li><strong>Strike Rate:</strong> {c.batting.strike_rate}</li>
            <li><strong>Average:</strong> {c.batting.average}</li>
            <li><strong>Highest:</strong> {c.batting.highest_inning_score}</li>
            <li><strong>Fours:</strong> {c.batting.four_x}</li>
            <li><strong>Sixes:</strong> {c.batting.six_x}</li>
          </ul>
        )}
        {c.bowling && (
          <ul>
            <li><strong>Wickets:</strong> {c.bowling.wickets}</li>
            <li><strong>Economy:</strong> {c.bowling.econ}</li>
            <li><strong>Best Bowling:</strong> {c.bowling.bestinning}</li>
          </ul>
        )}
      </div>
    ))}
  </div>
)}


    </div>
  );
};

export default PlayerDetails;
